async function callApi() {
  var requestOptions = {
    method: "GET",
    redirect: "follow",
    mode: "no-cors",
    headers: {
      "Content-Type": "application/json",
    },
  };

  let data = "";
  fetch(BASE_URL, requestOptions)
    .then((response) => {
      alert("a1");
      console.log(response); 
    })
    .then((result) => {
      alert("a2");
      console.log(result);
    })
    .catch((error) => console.log("error", error));
  return data;
}

const api = {
  badges: {
    list() {
      //return callApi("/usuarios");
      return callApi();
    },
  },
};

export default api;
